#include "synaptics78.h"
#include <libusb-1.0/libusb.h>
#include <iostream>
#include <string.h>
#include <opencv2/opencv.hpp>
#include <opencv2/core/core.hpp>
#include <opencv2/highgui/highgui.hpp>

#define VID            0x06cb
#define PID            0x0078
#define EP_INTR        0x83
#define EP_DATA_IN     0x81
#define EP_DATA_OUT    0x01
#define FP_WIDTH       144
#define FP_HEIHT       56

using namespace std;
using namespace cv;

bulkData hexStringToBulkData(char *hexString)
{
    char *p;
    int cnt = (strlen(hexString) + 1) / 2;
    unsigned char *result = (unsigned char *) malloc(cnt * sizeof(unsigned char)), *r;
    memset(result, 0, cnt * sizeof(unsigned char));
    unsigned int c;
    p = hexString;
    r = result;
    for (; *p; p += 2)
    {
        if (sscanf(p, "%02X", (unsigned int *) &c) != 1)
        {
            break;
        }
        *r++ = c;
    }
    bulkData ret;
    ret.content = result;
    ret.size = cnt * sizeof(unsigned char);
    return ret;
}

void printHex(unsigned char *input, size_t size)
{
    for (int i = 0; i < size; i++)
    {
        char zero = 0x00;
        if (input[i] == zero)
            printf("00");
        else
            printf("%02X", input[i]);
    }
}


void op(libusb_device_handle *hd, bulkData data, size_t revSize)
{
    bulkData rev = writeAndReadBulk(hd, data, revSize);
    cout << "Respond ";
    printHex(rev.content, rev.size);
    cout << endl;
}

bulkData writeAndReadBulk(libusb_device_handle *hd, bulkData data, size_t revSize)
{
    libusb_bulk_transfer(hd, EP_DATA_OUT, data.content, data.size, NULL, 0);
    cout << "Wrote ";
    printHex(data.content, data.size);
    cout << endl;
    unsigned char *rev;
    rev = (unsigned char *) malloc(revSize);
    memset(rev, 0, revSize);
    int a = 0;
    libusb_bulk_transfer(hd, EP_DATA_IN, rev, revSize, &a, 0);
    bulkData ret;
    ret.content = rev;
    ret.size = a;
    return ret;
}

void sendOneByte(libusb_device_handle *hd, unsigned char *data, size_t revSize)
{
    bulkData tempData;
    tempData.content = data;
    tempData.size = 1;
    op(hd, tempData, revSize);
}

int initProcess(libusb_device_handle *hd)
{
    sendOneByte(hd, (unsigned char *) "\x01", 102);
    sendOneByte(hd, (unsigned char *) "\x19", 128);
    bulkData data;
    data = hexStringToBulkData("08602000800b00000004");
    op(hd, data, 66);
    free(data.content);
    data = hexStringToBulkData("078020008004");
    op(hd, data, 70);
    free(data.content);
    sendOneByte(hd, (unsigned char *) "\x75", 74);
    sendOneByte(hd, (unsigned char *) "\x01", 102);
    sendOneByte(hd, (unsigned char *) "\x19", 128);
    sendOneByte(hd, (unsigned char *) "\x75", 74);
    data = hexStringToBulkData(
            "");
    op(hd, data, 66);
    free(data.content);
    data = hexStringToBulkData(
            "");
    libusb_bulk_transfer(hd, EP_DATA_OUT, data.content, data.size, NULL, 1000);
    free(data.content);
    data = hexStringToBulkData(
            "");
    op(hd, data, 2218);
    free(data.content);
    readINTR(hd);
}

unsigned char *readINTR(libusb_device_handle *hd)
{
    unsigned char *data;
    data = (unsigned char *) malloc(5 * sizeof(char));
    memset(data, 0, 5);
    libusb_interrupt_transfer(hd, EP_INTR, data, 5, NULL, 0);
    return data;

}

void waitForFingerOn(libusb_device_handle *hd)
{
    int continueFlag = 0;
    unsigned char *data = readINTR(hd);
    if (!strcmp((char *) data, "\x02\x00\x40\x10\x00"))
        cout << "Finger on!" << endl;
    else
    {
        cout << "Unknown first INTERRUPT_IN. Code is: ";
        printHex(data, 5);
        cout << endl;
    }
    free(data);
    data = readINTR(hd);
    if (!strcmp((char *) data, "\x03\x40\x01\x00\x00"))
    {
        cout << "Finger position correct(";
        printHex(data, 5);
        cout << "). Continue!" << endl;
    } else if (!strcmp((char *) data, "\x03\x50\x05\x00\x00"))
        cout << "Finger not in position. Retry" << endl;
    else
    {
        cout << "Unknow error INTERRUPT_IN, code is: ";
        printHex(data, 5);
        cout << endl;
    }
    free(data);
    data = readINTR(hd);
    if (!strcmp((char *) data, "\x03\x42\x04\x00\x40"))
    {
        cout << "All INTERRUPT_IN reveived. Continue!" << endl;
        continueFlag = 1;
        free(data);
    } else if (!strcmp((char *) data, "\x03\x41\x03\x00\x40"))
    {
        data = readINTR(hd);
        if (!strcmp((char *) data, "\x03\x43\x04\x00\x41"))
        {
            cout << "Received 4 INTERRUPT. Continue!" << endl;
            continueFlag = 1;
        }
        free(data);
    }

    if (continueFlag)
    {
        bulkData getImgCmd;
        getImgCmd.
                content = (unsigned char *) "\x51\x00\x20\x00\x00";
        getImgCmd.
                size = 5;
        bulkData img = writeAndReadBulk(hd, getImgCmd, 8146);
        printHex(img.content, img.size);
        cout << endl;
        bulkData data;
        data = hexStringToBulkData(
                "");
        libusb_bulk_transfer(hd,
                             EP_DATA_OUT, data.content, data.size, NULL, 1000);
        free(data.content);
        data = hexStringToBulkData(
                "");
        op(hd, data,
           2218);
        readINTR(hd);
        showImg(img);
    }

}

void showImg(bulkData data)
{
    unsigned char img[8064];
    memcpy(img, data.content + (8082 - 8064), 8064);
    cv::Mat image = cv::Mat(FP_HEIHT, FP_WIDTH, CV_8U, (unsigned *) img);
    cv::imwrite("fp.jpg", image);
}

int main()
{
    libusb_context *ctx = NULL;
    libusb_device_handle *fpHandler;
    if (libusb_init(&ctx) < 0)
    {
        cout << "Init Error" << endl;
    }
    libusb_set_option(ctx, LIBUSB_OPTION_LOG_LEVEL, 3);
    fpHandler = libusb_open_device_with_vid_pid(ctx, VID, PID);
    if (int ret = libusb_claim_interface(fpHandler, 0) < 0)
    {
        printf("claim interface error:%d\n", ret);
        libusb_exit(ctx);
        return 1;
    }
    if (fpHandler == NULL)
        cout << "cannot open device" << endl;
    initProcess(fpHandler);
    for (size_t i = 0; i < 1; i++)
        waitForFingerOn(fpHandler);
    libusb_close(fpHandler);
    libusb_exit(ctx);
    return 0;
}
